pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title MockToken
 * @dev Simple ERC20 token for testing purposes
 */
contract MockToken is ERC20, Ownable {
    uint8 private _decimals;

    constructor(
        string memory name,
        string memory symbol,
        uint8 decimals_,
        uint256 initialSupply
    ) ERC20(name, symbol) Ownable(msg.sender) {
        _decimals = decimals_;
        _mint(msg.sender, initialSupply);
    }

    function decimals() public view virtual override returns (uint8) {
        return _decimals;
    }

    /**
     * @dev Mint tokens to any address (for testing)
     */
    function mint(address to, uint256 amount) external onlyOwner {
        _mint(to, amount);
    }

    /**
     * @dev Burn tokens from any address (for testing)
     */
    function burn(address from, uint256 amount) external onlyOwner {
        _burn(from, amount);
    }

    /**
     * @dev Faucet function - anyone can get tokens for testing
     */
    function faucet(uint256 amount) external {
        require(amount <= 1000 * 10**_decimals, "Amount too large");
        _mint(msg.sender, amount);
    }
}

contracts/TriggerManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title TriggerManager - Universal Spot Trading Triggers
 * @dev Generic trigger system that works with ANY Hyperliquid spot asset
 * @notice Contract is token-agnostic - frontend/worker decide which tokens to support
 */
contract TriggerManager is AccessControl, ReentrancyGuard, Pausable {
    bytes32 public constant EXECUTOR_ROLE = keccak256("EXECUTOR_ROLE");

    // HyperCore Precompile Addresses
    address constant ORACLE_PRICES_PRECOMPILE_ADDRESS = 0x0000000000000000000000000000000000000807;
    address constant SPOT_ASSET_INFO_PRECOMPILE_ADDRESS = 0x000000000000000000000000000000000000080a;
    address constant SPOT_BALANCE_PRECOMPILE_ADDRESS = 0x0000000000000000000000000000000000000801;
    address constant TOKEN_INFO_PRECOMPILE_ADDRESS = 0x000000000000000000000000000000000000080C;

    // HyperCore CoreWriter contract (testnet only)
    address constant CORE_WRITER_ADDRESS = 0x3333333333333333333333333333333333333333;

    uint256 public constant MAX_SLIPPAGE = 50; // 50% max slippage protection
    uint256 public executionReward = 0.01 ether; // 0.01 HYPE reward for executors
    uint256 public nextTriggerId = 1;

    struct SpotAssetInfo {
        string name;           // Asset name (e.g., "BTC", "ETH")
        uint8 decimals;        // Price decimals
        uint256 minTradeSize;  // Minimum trade size
        bool isActive;         // Whether asset is tradeable
    }

    struct Trigger {
        uint256 id;
        address user;
        uint32 oracleIndex;        // Oracle index for price monitoring
        uint64 fromToken;          // Input token ID (what user deposits)
        uint64 targetToken;        // Target token ID for trading
        uint256 fromAmount;        // Amount of fromToken to swap
        uint256 triggerPrice;      // Target price (18 decimals)
        bool isAbove;              // true = trigger when price >= target, false = trigger when price <= target
        uint256 maxSlippage;       // Max slippage percentage (basis points, e.g., 500 = 5%)
        uint256 createdAt;
        bool isExecuted;
        bool isCancelled;
    }

    mapping(uint256 => Trigger) public triggers;
    mapping(address => uint256[]) public userTriggers;
    mapping(address => mapping(uint64 => uint256)) public userDeposits; // user => tokenId => amount

    event TriggerCreated(
        uint256 indexed triggerId,
        address indexed user,
        uint32 oracleIndex,
        uint64 fromToken,
        uint64 targetToken,
        uint256 fromAmount,
        uint256 triggerPrice,
        bool isAbove,
        uint256 maxSlippage
    );

    event TriggerExecuted(
        uint256 indexed triggerId,
        address indexed executor,
        uint256 executionPrice,
        uint256 outputAmount
    );

    event TriggerCancelled(uint256 indexed triggerId, address indexed user);

    event SwapExecuted(
        address indexed user,
        uint32 oracleIndex,
        uint64 fromToken,
        uint64 targetToken,
        uint256 inputAmount,
        uint256 outputAmount,
        uint256 executionPrice
    );

    // Custom errors
    error InsufficientDeposit();
    error TriggerNotFound();
    error UnauthorizedUser();
    error TriggerAlreadyExecuted();
    error TriggerConditionNotMet();
    error InvalidSlippage();
    error OracleCallFailed();
    error CoreWriterCallFailed();
    error InvalidAssetIndex();
    error ZeroAmount();
    error InsufficientBalance();

    constructor() {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(EXECUTOR_ROLE, msg.sender);
    }

    /**
     * @dev Get current price from oracle
     */
    function getOraclePrice(uint32 oracleIndex) public view returns (uint64) {
        (bool success, bytes memory result) = ORACLE_PRICES_PRECOMPILE_ADDRESS.staticcall(abi.encode(oracleIndex));
        if (!success) revert OracleCallFailed();
        return abi.decode(result, (uint64));
    }

    /**
     * @dev Get token info
     */
    function getTokenInfo(uint64 tokenId) public view returns (string memory name, uint8 szDecimals, uint8 weiDecimals) {
        (bool success, bytes memory result) = TOKEN_INFO_PRECOMPILE_ADDRESS.staticcall(abi.encode(uint32(tokenId)));
        if (!success) revert OracleCallFailed();

        (name, , , , , szDecimals, weiDecimals, ) = abi.decode(result, (string, uint64[], uint64, address, address, uint8, uint8, int8));
    }

    /**
     * @dev Get user's spot balance for a token
     */
    function getUserSpotBalance(address user, uint64 tokenId) public view returns (uint64 total, uint64 hold) {
        (bool success, bytes memory result) = SPOT_BALANCE_PRECOMPILE_ADDRESS.staticcall(abi.encode(user, tokenId));
        if (!success) revert OracleCallFailed();

        (total, hold, ) = abi.decode(result, (uint64, uint64, uint64));
    }

    /**
     * @dev Convert raw oracle price to human-readable price with 18 decimals
     */
    function convertOraclePrice(uint64 rawPrice, uint8 assetDecimals) public pure returns (uint256) {
        if (assetDecimals >= 18) {
            return uint256(rawPrice) / (10 ** (assetDecimals - 18));
        } else {
            return uint256(rawPrice) * (10 ** (18 - assetDecimals));
        }
    }

    /**
     * @dev Create a trigger for any input token to any target token
     */
    function createTrigger(
        uint32 oracleIndex,
        uint64 fromToken,
        uint64 targetToken,
        uint256 fromAmount,
        uint256 triggerPrice,
        bool isAbove,
        uint256 maxSlippage
    ) external payable nonReentrant whenNotPaused {
        if (fromAmount == 0) revert ZeroAmount();
        if (maxSlippage > MAX_SLIPPAGE * 100) revert InvalidSlippage(); // Max 50%

        // Always require HYPE for execution reward (via msg.value)
        if (msg.value < executionReward) revert InsufficientDeposit();

        // Validate oracle index exists by trying to get its price
        getOraclePrice(oracleIndex);

        // Validate tokens exist
        getTokenInfo(fromToken);
        getTokenInfo(targetToken);

        // For now, only support HYPE as fromToken until ERC20 mapping is implemented
        if (fromToken != 0) revert("Only HYPE supported as input token currently");

        // Transfer HYPE from user to contract
        if (msg.value != fromAmount + executionReward) revert InsufficientDeposit();

        uint256 triggerId = nextTriggerId++;

        triggers[triggerId] = Trigger({
            id: triggerId,
            user: msg.sender,
            oracleIndex: oracleIndex,
            fromToken: fromToken,
            targetToken: targetToken,
            fromAmount: fromAmount,
            triggerPrice: triggerPrice,
            isAbove: isAbove,
            maxSlippage: maxSlippage,
            createdAt: block.timestamp,
            isExecuted: false,
            isCancelled: false
        });

        userTriggers[msg.sender].push(triggerId);
        userDeposits[msg.sender][fromToken] += fromAmount;

        emit TriggerCreated(
            triggerId,
            msg.sender,
            oracleIndex,
            fromToken,
            targetToken,
            fromAmount,
            triggerPrice,
            isAbove,
            maxSlippage
        );
    }

    /**
     * @dev Execute a trigger when conditions are met
     */
    function executeTrigger(uint256 triggerId) external nonReentrant whenNotPaused onlyRole(EXECUTOR_ROLE) {
        Trigger storage trigger = triggers[triggerId];

        if (trigger.user == address(0)) revert TriggerNotFound();
        if (trigger.isExecuted || trigger.isCancelled) revert TriggerAlreadyExecuted();

        // Check trigger condition
        uint64 rawPrice = getOraclePrice(trigger.oracleIndex);
        (, uint8 szDecimals, ) = getTokenInfo(trigger.targetToken);

        // Convert oracle price to 18 decimals for comparison
        uint256 currentPrice = convertOraclePrice(rawPrice, szDecimals);

        bool conditionMet = trigger.isAbove ? 
            currentPrice >= trigger.triggerPrice : 
            currentPrice <= trigger.triggerPrice;

        if (!conditionMet) revert TriggerConditionNotMet();

        // Mark as executed
        trigger.isExecuted = true;

        // Perform any-to-any token swap
        uint256 outputAmount = _performAnyToAnySwap(
            trigger.user,
            trigger.fromToken,
            trigger.targetToken,
            trigger.fromAmount,
            trigger.maxSlippage,
            currentPrice,
            szDecimals
        );

        // Transfer execution reward (in HYPE) to executor
        payable(msg.sender).transfer(executionReward);

        // Update user deposits
        userDeposits[trigger.user][trigger.fromToken] -= trigger.fromAmount;

        emit TriggerExecuted(triggerId, msg.sender, currentPrice, outputAmount);
    }

    /**
     * @dev Execute immediate swap at current market price
     */
    function executeSwap(
        uint32 oracleIndex,
        uint64 fromToken,
        uint64 targetToken,
        uint256 fromAmount,
        uint256 maxSlippage
    ) external payable nonReentrant whenNotPaused {
        if (fromAmount == 0) revert ZeroAmount();
        if (maxSlippage > MAX_SLIPPAGE * 100) revert InvalidSlippage();

        // For now, only support HYPE as fromToken
        if (fromToken != 0) revert("Only HYPE supported as input token currently");

        // Transfer HYPE from user
        if (msg.value != fromAmount) revert InsufficientDeposit();

        // Get current price
        uint64 rawPrice = getOraclePrice(oracleIndex);
        (, uint8 szDecimals, ) = getTokenInfo(targetToken);
        uint256 currentPrice = convertOraclePrice(rawPrice, szDecimals);

        // Perform any-to-any swap
        uint256 outputAmount = _performAnyToAnySwap(
            msg.sender,
            fromToken,
            targetToken,
            fromAmount,
            maxSlippage,
            currentPrice,
            szDecimals
        );

        emit SwapExecuted(msg.sender, oracleIndex, fromToken, targetToken, fromAmount, outputAmount, currentPrice);
    }

    /**
     * @dev Cancel a trigger and refund deposit
     */
    function cancelTrigger(uint256 triggerId) external nonReentrant {
        Trigger storage trigger = triggers[triggerId];

        if (trigger.user != msg.sender) revert UnauthorizedUser();
        if (trigger.isExecuted || trigger.isCancelled) revert TriggerAlreadyExecuted();

        trigger.isCancelled = true;

        // For now, only HYPE refunds are supported
        if (trigger.fromToken != 0) revert("Only HYPE refunds supported currently");

        // Refund HYPE (fromAmount + executionReward)
        payable(msg.sender).transfer(trigger.fromAmount + executionReward);

        userDeposits[msg.sender][trigger.fromToken] -= trigger.fromAmount;

        emit TriggerCancelled(triggerId, msg.sender);
    }

    /**
     * @dev Get trigger details
     */
    function getTrigger(uint256 triggerId) external view returns (Trigger memory) {
        return triggers[triggerId];
    }

    /**
     * @dev Get user's trigger IDs
     */
    function getUserTriggers(address user) external view returns (uint256[] memory) {
        return userTriggers[user];
    }

    /**
     * @dev Get current price and token name
     */
    function getPriceAndTokenName(uint32 oracleIndex, uint64 tokenId) external view returns (uint256 price, string memory tokenName) {
        uint64 rawPrice = getOraclePrice(oracleIndex);
        (string memory name, uint8 szDecimals, ) = getTokenInfo(tokenId);
        uint256 convertedPrice = convertOraclePrice(rawPrice, szDecimals);
        return (convertedPrice, name);
    }

    /**
     * @dev Check if trigger condition is met
     */
    function isTriggerReady(uint256 triggerId) external view returns (bool conditionMet, uint256 currentPrice) {
        Trigger memory trigger = triggers[triggerId];

        if (trigger.user == address(0) || trigger.isExecuted || trigger.isCancelled) {
            return (false, 0);
        }

        uint64 rawPrice = getOraclePrice(trigger.oracleIndex);
        (, uint8 szDecimals, ) = getTokenInfo(trigger.targetToken);
        currentPrice = convertOraclePrice(rawPrice, szDecimals);

        conditionMet = trigger.isAbove ? 
            currentPrice >= trigger.triggerPrice : 
            currentPrice <= trigger.triggerPrice;
    }

    /**
     * @dev Calculate system address for a token
     * @param tokenId Token ID (0 for HYPE, others use index)
     */
    function getSystemAddress(uint64 tokenId) public pure returns (address) {
        if (tokenId == 0) {
            // HYPE has special system address
            return 0x2222222222222222222222222222222222222222;
        } else {
            // Other tokens: 0x20 + zeros + tokenId in big-endian
            // Start with 0x20 in the first byte (0x20 << 152 = 0x2000000000000000000000000000000000000000)
            uint256 systemAddressInt = (uint256(0x20) << 152) | uint256(tokenId);
            return address(uint160(systemAddressInt));
        }
    }

    /**
     * @dev Internal function to perform any-to-any token swap
     */
    function _performAnyToAnySwap(
        address user,
        uint64 fromToken,
        uint64 targetToken,
        uint256 inputAmount,
        uint256 /* maxSlippage */,
        uint256 referencePrice,
        uint8 targetTokenDecimals
    ) internal returns (uint256) {
        // Step 1: Send fromToken to user's HyperCore account
        // Action ID 6: Spot send (destination, token, wei)
        // fromToken is not HYPE, inputAmount in wei
        bytes memory sendTokenAction = abi.encodePacked(
            uint8(1),                    // Version 1
            uint24(6),                   // Action ID 6 (Spot send)
            abi.encode(user, fromToken, uint64(inputAmount)) // (destination, token, wei)
        );

        (bool success,) = CORE_WRITER_ADDRESS.call(
            abi.encodeWithSignature("sendRawAction(bytes)", sendTokenAction)
        );
        if (!success) revert CoreWriterCallFailed();

        // Step 2: Convert fromToken to USDC first (since all pairs are USDC-based)
        // Assume USDC is token 1 - this needs to be confirmed
        if (fromToken != 1) { // If fromToken is not USDC, need fromToken -> USDC first
            bytes memory tokenToUsdcAction = abi.encodePacked(
                uint8(1),                    // Version 1
                uint24(1),                   // Action ID 1 (Limit order)
                abi.encode(
                    uint32(1),               // USDC spot pair (needs confirmation)
                    true,                    // isBuy (buy USDC with fromToken)
                    uint64(referencePrice),  // Market price
                    uint64(inputAmount),     // Size in fromToken
                    false,                   // reduceOnly
                    uint8(3),                // encodedTif (3 = IOC - Immediate Or Cancel)
                    uint128(0)               // cloid (0 = no client order id)
                )
            );

            (success,) = CORE_WRITER_ADDRESS.call(
                abi.encodeWithSignature("sendRawAction(bytes)", tokenToUsdcAction)
            );
            if (!success) {
                // If fromToken -> USDC fails, send fromToken back to user on HyperEVM
                _bridgeTokenBack(user, fromToken, inputAmount);
                revert CoreWriterCallFailed();
            }
        }

        // Step 3: Convert USDC to target token (if target is not USDC)
        uint256 expectedOutput = inputAmount; // Will be updated based on actual calculations

        if (targetToken != 1) { // If target is not USDC
            // Calculate USDC amount (simplified - in practice would need actual conversion)
            uint256 usdcAmount = inputAmount; // Placeholder

            // USDC -> Target Token
            bytes memory usdcToTargetAction = abi.encodePacked(
                uint8(1),                    // Version 1
                uint24(1),                   // Action ID 1 (Limit order)
                abi.encode(
                    uint32(targetToken),     // Target token spot pair
                    true,                    // isBuy (buy target with USDC)
                    uint64(referencePrice),  // Market price
                    uint64(usdcAmount),      // Size in USDC
                    false,                   // reduceOnly
                    uint8(3),                // encodedTif (3 = IOC)
                    uint128(0)               // cloid
                )
            );

            (success,) = CORE_WRITER_ADDRESS.call(
                abi.encodeWithSignature("sendRawAction(bytes)", usdcToTargetAction)
            );
            if (!success) {
                // If USDC -> Target fails, send USDC back to user on HyperEVM
                _bridgeTokenBack(user, 1, usdcAmount);
                revert CoreWriterCallFailed();
            }

            // Calculate expected output in target token
            expectedOutput = (usdcAmount * (10 ** targetTokenDecimals)) / referencePrice;
        }

        // Step 4: Bridge target tokens back to HyperEVM
        uint64 finalTokenId = (targetToken == 1) ? 1 : targetToken; // USDC or target token
        uint256 finalAmount = (targetToken == 1) ? inputAmount : expectedOutput;

        _bridgeTokenBack(user, finalTokenId, finalAmount);

        return finalAmount;
    }

    /**
     * @dev Bridge tokens from HyperCore back to HyperEVM
     * @param tokenId Token ID to bridge
     * @param amount Amount to bridge
     */
    function _bridgeTokenBack(address /* user */, uint64 tokenId, uint256 amount) internal {
        // Action ID 6: Spot send to system address bridges back to HyperEVM
        address systemAddress = getSystemAddress(tokenId);

        bytes memory bridgeAction = abi.encodePacked(
            uint8(1),                    // Version 1
            uint24(6),                   // Action ID 6 (Spot send)
            abi.encode(systemAddress, tokenId, uint64(amount)) // (system address, token, amount)
        );

        (bool success,) = CORE_WRITER_ADDRESS.call(
            abi.encodeWithSignature("sendRawAction(bytes)", bridgeAction)
        );
        if (!success) revert CoreWriterCallFailed();

        // The system will automatically call transfer() on the linked ERC20 contract
        // crediting the tokens to the original user on HyperEVM
    }

    // Admin functions
    function pause() external onlyRole(DEFAULT_ADMIN_ROLE) {
        _pause();
    }

    function unpause() external onlyRole(DEFAULT_ADMIN_ROLE) {
        _unpause();
    }

    function setExecutionReward(uint256 newReward) external onlyRole(DEFAULT_ADMIN_ROLE) {
        executionReward = newReward;
    }

    function grantExecutorRole(address executor) external onlyRole(DEFAULT_ADMIN_ROLE) {
        _grantRole(EXECUTOR_ROLE, executor);
    }

    function revokeExecutorRole(address executor) external onlyRole(DEFAULT_ADMIN_ROLE) {
        _revokeRole(EXECUTOR_ROLE, executor);
    }

    // Emergency functions
    function emergencyWithdraw() external onlyRole(DEFAULT_ADMIN_ROLE) {
        payable(msg.sender).transfer(address(this).balance);
    }

    receive() external payable {
        // Accept HYPE deposits
    }
}

